import React, { Component } from 'react';

class Filter extends Component {
  constructor(props) {
    super(props);
    this.state = {
      tag: props.tag,
    }
  }

  render() {
    return (
      <div className="tag" onClick={this.props.onClick}>
        {this.state.tag}
      </div>
    );
  }
}

export default Filter;
